// kaia_*, klay_* -> eth_* 동일 응답 예시 매핑 (자기 참조 방지)
const ETH_EQUIVALENT_SUFFIXES = [
  "blockNumber",
  "call",
  "chainId",
  "createAccessList",
  "estimateGas",
  "feeHistory",
  "gasPrice",
  "getBalance",
  "getBlockByHash",
  "getBlockByNumber",
  "getBlockReceipts",
  "getBlockTransactionCountByHash",
  "getBlockTransactionCountByNumber",
  "getCode",
  "getFilterChanges",
  "getFilterLogs",
  "getLogs",
  "getProof",
  "getStorageAt",
  "getTransactionByBlockHashAndIndex",
  "getTransactionByBlockNumberAndIndex",
  "getTransactionByHash",
  "getTransactionCount",
  "getTransactionReceipt",
  "maxPriorityFeePerGas",
  "newBlockFilter",
  "newFilter",
  "newPendingTransactionFilter",
  "sendRawTransaction",
  "uninstallFilter",
] as const;

for (const suffix of ETH_EQUIVALENT_SUFFIXES) {
  const ethKey = `eth_${suffix}` as keyof typeof Examples;
  const ethExample = Examples[ethKey];
  if (ethExample && Object.keys(ethExample).length > 0) {
    (Examples as Record<string, unknown>)[`kaia_${suffix}`] = ethExample;
    (Examples as Record<string, unknown>)[`klay_${suffix}`] = ethExample;
  }
}

export default Examples;
